import React from "react";
import styles from './UserList.module.css'

const UserList = (props) => {
    console.log(props.dataToRender);

    let userCard = <p>No cards added yet.</p>;
if (props.dataToRender.length === 0) {
    return userCard;
} else {
    userCard = props.dataToRender.map((card) => (<li key={card.id}>{card.Username}({card.Age} years old)</li>));
      }

    return (
        <div className={styles.users}> <ul>{ userCard}</ul></div>  

   );
};

export default UserList;
